import { Center, Text, Flex } from "@chakra-ui/react";

const Message = () => {
  return (
    <Flex w="100%" h="80%" overflowY="scroll" flexDirection="column" p="3">
      <Center borderRadius='lg' backgroundColor='red.100' p='10px' background='black'>
        <Text>
          This is a message!
        </Text>
      </Center>
    </Flex>
  );
};

export default Message;
